import React from 'react';

const MyPage = () => {
  return (
    <div className="bg-white shadow-md rounded p-6">
      <h1 className="text-2xl font-bold mb-4">마이페이지</h1>
      <p>여기에서 프로필을 관리하고 경기 신청 내역을 확인하세요.</p>
    </div>
  );
};

export default MyPage;
